This video was done by professionals under the supervision of professionals on a closed course! 

In today’s video, we Cummins motor swap our dually Ford Ranger because it didn’t have enough power to tow our wake boat.  Later we test the Ford Ranger to its max towing ability towing a Train with 260,000 lbs of weight in it and finishing with a tow off against a Sherp.

